import { StyleSheet} from 'react-native';
import { SearchBar } from 'react-native-elements';

const stylesHome = StyleSheet.create({
    home:{
        backgroundColor: '#080909',
        width: '100%',
        height: '100%'
    },
    icon: {
        marginTop: '15%',
        marginLeft: '-80%',
    },
    searchBar:{
        backgroundColor: 'green'
    }
});

export default stylesHome;
